import AppHeader from '../App/AppHeader/header'
import MainPage from '../App/MainPage/MainPage';
import Content from '../App/ContentPage/Content';
import AboutUs from '../App/AboutUs/AboutUs';
import AboutUsExtra from '../App/AboutUsExtra/AboutUsExtra';
import Experts from '../App/Experts/Experts';
import Footer from '../App/AppFooter/Footer';
import { ThemeProvider } from '../App/ThemeSwitch/ThemeContext';
import ThemeSwitcher from '../App/ThemeSwitch/ThemeSwitcher';
import Bgc from '../App/ThemeSwitch/Bgc'
function App() {
  return (
    <div className="App">

    <ThemeProvider>
      <AppHeader/>
      <ThemeSwitcher/>
      <MainPage/>
      <Content/>
      <AboutUs/>
      <AboutUsExtra/>
      <Experts/>
      <Footer/>
      </ThemeProvider>
    </div>
  );
}

export default App;
